import React, { Component } from "react";
import bank from "../bank.png";
import { DropdownButton } from "react-bootstrap";

// create class for component
class Navbar extends Component {
  render() {
    return (
      <nav
        className="navbar navbar-dark fixed-top shadow p-0"
        style={{ backgroundColor: "black", height: "50px" }}
      >
        <a
          className="navbar-brand col-sm-3 col-md-2 mr-0"
          style={{ color: "white" }}
        >
          <img
            alt="bank logo"
            src={bank}
            width="50"
            height="35"
            className="d-inline-block align-top"
          />
          &ensp; Dapp Staking Bank
        </a>
        <ul className="navbar-nav px-3">
          <li className="text-nowrap d-none nav-item d-sm-none d-sm-block">
            <small style={{ color: "white" }}>
              {/* Account Number: {this.props.account} */}
              <DropdownButton>
                <DropdownButton.Toggle variant="success" id="dropdown-basic">
                  Dropdown Button
                </DropdownButton.Toggle>

                <DropdownButton.Menu>
                  <DropdownButton.Item href="#/action-1">
                    Action
                  </DropdownButton.Item>
                  <DropdownButton.Item href="#/action-2">
                    Another action
                  </DropdownButton.Item>
                  <DropdownButton.Item href="#/action-3">
                    Something else
                  </DropdownButton.Item>
                </DropdownButton.Menu>
              </DropdownButton>
            </small>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Navbar;
